import React, { Component } from 'react'

class WeatherApp extends Component {
  render() {
    return (
      <div>
        <ul className="list-inline list-wrapper clearfix">
          {this.props.city && this.props.country && <li>Location: {this.props.city}, {this.props.country}</li>}
          {this.props.temperature && <li>Temperature: {this.props.temperature}</li>}
          {this.props.humidity && <li>Humidity: {this.props.humidity}</li>}
          {this.props.description && <li>Description: {this.props.description}</li>}

        </ul>
      </div>
    )
  }
}

export default WeatherApp;
